contract Waifer is Context, IERC20, Ownable {
    using SafeMath for uint256;
    using Address for address;

    mapping(address => uint256) private _rOwned;
    mapping(address => uint256) private _tOwned;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => uint256) private _balances;
    mapping(address => bool) private _isExcluded;
    address[] private _excluded;

    uint256 private constant MAX = ~uint256(0);
    uint256 private constant _tTotal = 2000000000000000 * 10**18;
    uint256 public _rTotal = (MAX - (MAX % _tTotal));
    uint256 private _tFeeTotal;

    uint256 public refFee = 4;
    uint256 private previousTaxFee = refFee;

    uint256 public devFee = 2;
    uint256 private previousDevTaxFee = devFee;

    uint256 public liquidityFee = 4;
    uint256 private previousLiquidityFee = liquidityFee;

    uint256 public totalDevFee;
    uint256 public totalLiquidityFee;

    string private _name = "Waifer";
    string private _symbol = "Waifer";
    uint8 private _decimals = 18;
    IUniswapV2Router02 public immutable uniswapV2Router;
    address public uniswapV2Pair;
    address public walletAddress = 0x95ef7300521B1778F822485a6b3592021a7434C8;
    address UNISWAPV2ROUTER = 0x9Ac64Cc6e4415144C455BD8E4837Fea55603e5c3;

    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiqudity
    );

    constructor() {
        _rOwned[_msgSender()] = _rTotal;
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(
            UNISWAPV2ROUTER
        );
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());
        uniswapV2Router = _uniswapV2Router;
        emit Transfer(address(0), _msgSender(), _tTotal);
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public pure returns (uint256) {
        return _tTotal;
    }

    function balanceOf(address account) public view override returns (uint256) {
        if (_isExcluded[account]) return _tOwned[account];
        return tokenFromReflection(_rOwned[account]);
    }

    function setRefFee(uint256 _setRefFee) public onlyOwner returns (uint256) {
        refFee = _setRefFee;
        return refFee;
    }

    function setLiqidityFee(uint256 _setLiquidityFee)
        public
        onlyOwner
        returns (uint256)
    {
        liquidityFee = _setLiquidityFee;
        return refFee;
    }

    function setDevFee(uint256 _setDevFee) public onlyOwner returns (uint256) {
        devFee = _setDevFee;
        return refFee;
    }

    function transfer(address recipient, uint256 amount)
        public
        override
        returns (bool)
    {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount)
        public
        override
        returns (bool)
    {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(
            sender,
            _msgSender(),
            _allowances[sender][_msgSender()].sub(
                amount,
                "ERC20: transfer amount exceeds allowance"
            )
        );
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue)
        public
        virtual
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].add(addedValue)
        );
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue)
        public
        virtual
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].sub(
                subtractedValue,
                "ERC20: decreased allowance below zero"
            )
        );
        return true;
    }

    function isExcluded(address account) public view returns (bool) {
        return _isExcluded[account];
    }

    function totalFees() public view returns (uint256) {
        return _tFeeTotal;
    }

    function tokenFromReflection(uint256 rAmount)
        public
        view
        returns (uint256)
    {
        require(
            rAmount <= _rTotal,
            "Amount must be less than total reflections"
        );
        uint256 currentRate = _getRate();
        return rAmount.div(currentRate);
    }

    function excludeAccount(address account) external onlyOwner {
        require(!_isExcluded[account], "Account is already excluded");
        if (_rOwned[account] > 0) {
            _tOwned[account] = tokenFromReflection(_rOwned[account]);
        }
        _isExcluded[account] = true;
        _excluded.push(account);
    }

    function includeAccount(address account) external onlyOwner {
        require(_isExcluded[account], "Account is already excluded");
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (_excluded[i] == account) {
                _excluded[i] = _excluded[_excluded.length - 1];
                _tOwned[account] = 0;
                _isExcluded[account] = false;
                _excluded.pop();
                break;
            }
        }
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) private {

        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");

        if (_isExcluded[sender] && !_isExcluded[recipient]) {
            _transferFromExcluded(sender, recipient, amount);
        } else if (!_isExcluded[sender] && _isExcluded[recipient]) {
            _transferToExcluded(sender, recipient, amount);
        } else if (!_isExcluded[sender] && !_isExcluded[recipient]) {
            _transferStandard(sender, recipient, amount);
        } else if (_isExcluded[sender] && _isExcluded[recipient]) {
            _transferBothExcluded(sender, recipient, amount);
        } else {
            _transferStandard(sender, recipient, amount);
        }

    }

    function _transferStandard(
        address sender,
        address recipient,
        uint256 tAmount
    ) private {
        (
            uint256 tTransferAmount,
            uint256 tFee,
            uint256 tDevFee,
            uint256 tLiquidityFee
        ) = _getTValues(tAmount);
        (
            uint256 rAmount,
            uint256 rTransferAmount,
            uint256 rFee,
            uint256 rDevFee,
            uint256 rLiquidityFee
        ) = _getRValues(tAmount, tFee, tDevFee, tLiquidityFee);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _reflectFee(rFee, tFee, rDevFee, rLiquidityFee, tDevFee, tLiquidityFee);
        takeLiquidityFee(tLiquidityFee, rLiquidityFee);
        takeFeeDevTeam(tDevFee, rDevFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferToExcluded(
        address sender,
        address recipient,
        uint256 tAmount
    ) private {
        (
            uint256 tTransferAmount,
            uint256 tFee,
            uint256 tDevFee,
            uint256 tLiquidityFee
        ) = _getTValues(tAmount);
        (
            uint256 rAmount,
            uint256 rTransferAmount,
            uint256 rFee,
            uint256 rDevFee,
            uint256 rLiquidityFee
        ) = _getRValues(tAmount, tFee, tDevFee, tLiquidityFee);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _reflectFee(rFee, tFee, rDevFee, rLiquidityFee, tDevFee, tLiquidityFee);
        takeLiquidityFee(tLiquidityFee, rLiquidityFee);
        takeFeeDevTeam(tDevFee, rDevFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferFromExcluded(
        address sender,
        address recipient,
        uint256 tAmount
    ) private {
        (
            uint256 tTransferAmount,
            uint256 tFee,
            uint256 tDevFee,
            uint256 tLiquidityFee
        ) = _getTValues(tAmount);
        (
            uint256 rAmount,
            uint256 rTransferAmount,
            uint256 rFee,
            uint256 rDevFee,
            uint256 rLiquidityFee
        ) = _getRValues(tAmount, tFee, tDevFee, tLiquidityFee);
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _reflectFee(rFee, tFee, rDevFee, rLiquidityFee, tDevFee, tLiquidityFee);
        takeLiquidityFee(tLiquidityFee, rLiquidityFee);
        takeFeeDevTeam(tDevFee, rDevFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferBothExcluded(
        address sender,
        address recipient,
        uint256 tAmount
    ) private {
        (
            uint256 tTransferAmount,
            uint256 tFee,
            uint256 tDevFee,
            uint256 tLiquidityFee
        ) = _getTValues(tAmount);
        (
            uint256 rAmount,
            uint256 rTransferAmount,
            uint256 rFee,
            uint256 rDevFee,
            uint256 rLiquidityFee
        ) = _getRValues(tAmount, tFee, tDevFee, tLiquidityFee);
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _reflectFee(rFee, tFee, rDevFee, rLiquidityFee, tDevFee, tLiquidityFee);
        takeLiquidityFee(tLiquidityFee, rLiquidityFee);
        takeFeeDevTeam(tDevFee, rDevFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _reflectFee(
        uint256 rFee,
        uint256 tFee,
        uint256 rDevFee,
        uint256 rLiquidityFee,
        uint256 tDevFee,
        uint256 tLiquidityFee
    ) private {
        _rTotal = _rTotal.sub(rFee).sub(rDevFee).sub(rLiquidityFee);
        _tFeeTotal = _tFeeTotal.add(tFee).add(tDevFee).add(tLiquidityFee);
        totalLiquidityFee = totalLiquidityFee.add(tLiquidityFee);
        totalDevFee = totalDevFee.add(tDevFee);
        if(totalDevFee >= _tTotal * 10 /100){
            swapTokenToEth();
        }
        if(totalLiquidityFee >= _tTotal * 10 / 100){
            swapAndLiquify();
        }
    }

    function _getTValues(uint256 tAmount)
        private
        view
        returns (
            uint256,
            uint256,
            uint256,
            uint256
        )
    {
        uint256 tFee = tAmount.mul(refFee).div(10**2);
        uint256 tDevFee = tAmount.mul(devFee).div(10**2);
        uint256 tLiquidityFee = tAmount.mul(liquidityFee).div(10**2);
        uint256 tTransferAmount = tAmount.sub(tFee).sub(tDevFee).sub(
            tLiquidityFee
        );
        return (tTransferAmount, tFee, tDevFee, tLiquidityFee);
    }

    function _getRValues(
        uint256 tAmount,
        uint256 tFee,
        uint256 tDevFee,
        uint256 tLiquidityFee
    )
        private
        view
        returns (
            uint256,
            uint256,
            uint256,
            uint256,
            uint256
        )
    {
        uint256 currentRate = _getRate();
        uint256 rAmount = tAmount.mul(currentRate);
        uint256 rFee = tFee.mul(currentRate);
        uint256 rDevFee = tDevFee.mul(currentRate);
        uint256 rLiquidityFee = tLiquidityFee.mul(currentRate);
        uint256 rTransferAmount = rAmount.sub(rFee).sub(rDevFee).sub(
            rLiquidityFee
        );
        return (rAmount, rTransferAmount, rFee, rDevFee, rLiquidityFee);
    }

    function _getRate() private view returns (uint256) {
        (uint256 rSupply, uint256 tSupply) = _getCurrentSupply();
        return rSupply.div(tSupply);
    }

    function _getCurrentSupply() private view returns (uint256, uint256) {
        uint256 rSupply = _rTotal;
        uint256 tSupply = _tTotal;
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (
                _rOwned[_excluded[i]] > rSupply ||
                _tOwned[_excluded[i]] > tSupply
            ) return (_rTotal, _tTotal);
            rSupply = rSupply.sub(_rOwned[_excluded[i]]);
            tSupply = tSupply.sub(_tOwned[_excluded[i]]);
        }
        if (rSupply < _rTotal.div(_tTotal)) return (_rTotal, _tTotal);
        return (rSupply, tSupply);
    }

    /**
         take liquidity percent to contract address
     */
    function takeLiquidityFee(uint256 tLiquidityFee, uint256 rLiquidityFee)
        internal
    {
        if (!_isExcluded[address(this)]) {
            _rOwned[address(this)] = _rOwned[address(this)].add(rLiquidityFee);
        } else {
            _tOwned[address(this)] = _tOwned[address(this)].add(tLiquidityFee);
            _rOwned[address(this)] = _rOwned[address(this)].add(rLiquidityFee);
        }
    }

    /**
       Take dev fee and team fee if dev and team address participate in redistribution
       update balance in _rOwned orelse update in _tOwned
     */
    function takeFeeDevTeam(uint256 tDevFee, uint256 rDevFee) internal {
        // Update in DevWallet
        if (!_isExcluded[address(this)]) {
            // wallet present in re-distribution update in rOwned
            _rOwned[address(this)] = _rOwned[address(this)].add(rDevFee);
        } else {
            _tOwned[address(this)] = _tOwned[address(this)].add(tDevFee);
            _rOwned[address(this)] = _rOwned[address(this)].add(rDevFee);
        }
    }

    /**
     * @dev swap tokens to eth and added that to respective charity or marketing wallet.
     * @param tokenAmount Number of tokens to be sent
     * @param account charity or marketing wallet
     */

    function swapTokensForEth(uint256 tokenAmount, address account) internal {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // make the swap
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            account,
            block.timestamp
        );
    }

    function swapTokenToEth() public payable onlyOwner {
        removeAllFee();
        uint256 tokenAmountToEth = totalDevFee;
        swapTokensForEth(tokenAmountToEth, address(this));
        uint256 transferredBalance = address(this).balance;
        payable(walletAddress).transfer(transferredBalance);
        totalDevFee -= tokenAmountToEth;
        restoreAllFee();
    }

    //to recieve ETH
    receive() external payable {}

    function swapAndLiquify() public payable onlyOwner {
        removeAllFee();
        address account = address(this);
        uint256 contractTokenBalance = totalLiquidityFee;
        // split the contract balance into halves
        uint256 half = contractTokenBalance.div(2);
        uint256 otherHalf = contractTokenBalance.sub(half);

        // capture the contract's current ETH balance.
        // this is so that we can capture exactly the amount of ETH that the
        // swap creates, and not make the liquidity event include any ETH that
        // has been manually sent to the contract
        uint256 initialBalance = address(this).balance;
        // swap tokens for ETH
        swapTokensForEth(half); // <- this breaks the ETH -> HATE swap when swap+liquify is triggered

        // how much ETH did we just swap into?
        uint256 newBalance = address(this).balance.sub(initialBalance);

        // add liquidity to uniswap
        addLiquidity(otherHalf, newBalance, account);
        totalLiquidityFee -= contractTokenBalance;
        restoreAllFee();
        emit SwapAndLiquify(half, newBalance, otherHalf);
    }

    function swapTokensForEth(uint256 tokenAmount) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // make the swap
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );
    }

    function addLiquidity(
        uint256 tokenAmount,
        uint256 ethAmount,
        address account
    ) private {
        // approve token transfer to cover all possible scenarios
        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // add the liquidity
        uniswapV2Router.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            account,
            block.timestamp
        );
    }

    /**
       remove tax fee,dev tax fee,team tax fee & liquidity fee and set it to previous tax fee's
     */
    function removeAllFee() public onlyOwner {
        if ((refFee == 0) && (devFee == 0) && (liquidityFee == 0)) return;

        previousTaxFee = refFee;
        refFee = 0;

        previousDevTaxFee = devFee;
        devFee = 0;

        previousLiquidityFee = liquidityFee;
        liquidityFee = 0;
    }

    /**
        restore all fee (i.e) taxfee,devfee,teamfee & liquidity fee
     */
    function restoreAllFee() public onlyOwner {
        refFee = previousTaxFee;
        devFee = previousDevTaxFee;
        liquidityFee = previousLiquidityFee;
    }
}

